import { useEffect, useState } from "react";

const Saved = () => {
  const [savedFiles, setSavedFiles] = useState([]);
  const token = localStorage.getItem("token");

  useEffect(() => {
    fetchSavedFiles();
  }, []);

  const fetchSavedFiles = async () => {
    try {
      const response = await fetch("http://127.0.0.1:8000/api/upload-template/", {
        method: "GET",
        headers: {
          "Authorization": `Token ${token}`
        }
      });

      if (!response.ok) {
        throw new Error("Failed to fetch saved files");
      }

      const data = await response.json();
      setSavedFiles(data);
    } catch (error) {
      console.error("Error fetching saved files:", error);
    }
  };

  return (
    <div className="flex flex-1 flex-col">
      <h1 className="text-4xl bg-cblue text-white font-bold p-2.5 text-center">
        Saved Files
      </h1>
      <table className="table-fixed bg-white mt-10">
        <thead>
          <tr>
            <th className="px-4 py-2">File Name</th>
            <th className="px-4 py-2">Download</th>
          </tr>
        </thead>
        <tbody>
          {savedFiles.map((file) => (
            <tr key={file.id}>
              <td className="border px-4 py-2">{file.filename}</td>
              <td className="border px-4 py-2">
                <a href={file.file} download={file.filename} className="text-blue-500 hover:underline">
                  Download
                </a>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Saved;
